package client

import (
	"encoding/base64"
	"fmt"
	"io/ioutil"
	"testing"
	"time"
)

func TestTxImgToImg(t *testing.T) {
	err := initTest("../../../config/configTest.toml")
	if err != nil {
		t.Error(err)
		panic(err)
	}
	client := NewTxCloudClient()
	resp, err := client.PostImgToImg("", "")
	if err != nil {
		t.Error(err)
		panic(err)
	}
	data, err := base64.StdEncoding.DecodeString(resp.Response.ResultImage)
	if err != nil {
		t.Error(err)
		panic(err)
	}
	path := fmt.Sprintf("./%d.jpg", time.Now().Unix())
	err = ioutil.WriteFile(path, data, 0644)
	if err != nil {
		t.Error(err)
		panic(err)
	}
}
